    def mousePressEvent(self, event):
        self.oldPos = event.globalPos()
    def mouseMoveEvent(self, event):
        try:
            delta = QtCore.QPoint(event.globalPos() - self.oldPos)
            self.move(self.x() + delta.x(), self.y() + delta.y())
            self.oldPos = event.globalPos()
        except (AttributeError, UnboundLocalError):
            pass

    def insert_icon(self,text):
        row,column = self.tableWidget.currentRow(),self.tableWidget.currentColumn()
        thing = self.tableWidget.item(row,column)
        if thing is not None and thing.text() != '':
            if '~' in thing.text():
                item = thing.text().replace(thing.text().split('~')[1],text)
            else:
                item = thing.text()+"~"+ text
        else :
            item = "~"+ text
        if column == 7 :
            self.tableWidget.setItem(row,column,QtWidgets.QTableWidgetItem(item))             
            